    geoip-code: CN
    ipcidr:
      - 240.0.0.0/4
      - 0.0.0.0/32

tun:
  enable: true
  stack: system
  dns-hijack:
    - any:53
  auto-route: true
  auto-detect-interface: true

profile:
  store-selected: true
  store-fake-ip: true
tcp-concurrent: true

